import classes from './ToolBarStyle.module.css';
import logo from '../Assets/images/burger-logo.png'
const Toolbar = () => {
 return (
  <>
   <div className={classes.Toolbarwrapper}>
    <div className={classes.LogoWrapper}> <img src={logo} /> </div>

   </div>
  </>
 )
}

export default Toolbar;
